function findKey(LibraryAtKey, inputKey) {
	// Find the sum of all elements in LibraryAtKey
	var total = parseInt(LibraryAtKey[0]); 
	for (var i = 1; i < 128; i++) {
		total += parseInt(LibraryAtKey[i]); 
	}
	// Now translate the elements into a new array for targets
	var targetKeys = []; 
	targetKeys.push(parseInt(LibraryAtKey[0])); 
	for (var i = 1; i < 128; i++) {
		targetKeys.push(parseInt(targetKeys[i - 1]) + parseInt(LibraryAtKey[i])); 
	}
	
	// Generate a random number
	var ret = 0; 
	var attemptTries = 0; 
	
	while (!(inputKey - 12 <= ret && ret <= inputKey + 12)) {
		var number = 1 + parseInt(Math.random() * (parseInt(total) - 1.0)); 
		attemptTries ++; 
		if (attemptTries > 100) {
			return 64; 
		}
		// Set where the number struck on the keys
		
		for (var i = 1; i < 128; i++) {
			if (targetKeys[i - 1] <= number && number <= targetKeys[i]) ret = i; 
		}
	}
	
	
	return ret; 
}

// Returns an randomized array with notes generated according to inputKey. 
function generatePattern(inputKey) {
	// Initialize Variables
	var numberOfNotes = parseInt(30 + Math.random() * 20); 
	var currentKey = inputKey; 
	var generatedKeys = []; 
	// Add the first key
	generatedKeys.push(parseInt(inputKey)); 
	// Now generate keys according to library
	for (var i = 1; i < numberOfNotes; i++) {
		var nextKeyTables = LibraryArray[currentKey]; 
		// Find the next key
		var nextKey = findKey(nextKeyTables, currentKey);
		// Place next key into generated keys
		generatedKeys.push(parseInt(nextKey)); 
		// Update current key
		currentKey = nextKey; 
	}
	return generatedKeys; 
}

function generateRandomPatternGaps() {
	var rhythm1 = new Array(60);
	var pointer = 0;     
	
	while (pointer<=49){
		var rand = parseInt(Math.random()*11+1);

		switch (rand){
			case 1:
				rhythm1[pointer] = 1000*1.5;
				pointer++;
			case 2, 3, 4, 5, 6:
				rhythm1[pointer] = 500*1.5;
				pointer++;
			case 7, 8:
				rhythm1[pointer] = 250*1.5;
				pointer++;
				rhythm1[pointer] = 250*1.5;
				pointer++;
			case 9, 10:
				rhythm1[pointer] = 125*1.5;
				pointer++;
				rhythm1[pointer] = 125*1.5;
				pointer++;
				rhythm1[pointer] = 125*1.5;
				pointer++;
				rhythm1[pointer] = 125*1.5;
				pointer++;
			case 11:
				rhythm1[pointer] = 167*1.5;
				pointer++;
				rhythm1[pointer] = 167*1.5;
				pointer++;
				rhythm1[pointer] = 167*1.5;
				pointer++;
		}
		
	}
	return rhythm1; 
}

// Returns an array of LengthOfPattern - 1 specifying random time gaps. 
function generatePatternGaps(LengthOfPattern) {
	return generateRandomPatternGaps() ; 
}

