// Defines the playback object
function playBack(inputKey) {
	var notes = generatePattern(inputKey); 
	var intervals = generatePatternGaps(notes.length); 
	
	var isPlaying = true; 
	var playbackIndex = 0; 
	
	this.play = function () {
		isPlaying = true; 
		playbackIndex = 0; 
		playNextNote(); 
	}
	
	this.stop = function () {
		isPlaying = false; 
	}
	
	function playNextNote() {
		// Check if there is a note to play, and if playback is enabled.
		if (!isPlaying || playbackIndex >= notes.length) return; 
		// Play the stuff. 
		var note = notes[playbackIndex];
		var delay = 0; 
		var velocity = 127; 
		if (note > 0) {
			MIDI.setVolume(0, 127);
			MIDI.noteOn(0, note, velocity, delay);
			MIDI.noteOff(0, note, delay + 0.75);
		}
		playbackIndex ++; 
		console.log(intervals[playbackIndex - 1]);
		pushRDot(note - 33); 
		setTimeout(playNextNote, intervals[playbackIndex - 1]); 
	}
}

function refreshIns() {
	if (!(localStorage.getItem("ittybittyditty.selectedInstrument") == instrumentName)) {
		instrumentName = localStorage.getItem("ittybittyditty.selectedInstrument"); 
		loadInstrumentAggregate(localStorage.getItem("ittybittyditty.selectedInstrument")); 
	}
	if (!(localStorage.getItem("ittybittyditty.selectedLibrary") == libraryName)) {
		libraryName = localStorage.getItem("ittybittyditty.selectedLibrary"); 
		switch (libraryName) {
			case "Four Chords": 
				fillLibraryArray(); 
				break; 
			case "Modern and Electronic Pop": 
				fillLibraryArrayModern(); 
				break; 
			case "Instrumental Classics": 
				fillLibraryArrayInstrumentalClassics(); 
				break; 
		}
		Materialize.toast('Library switched. ', 4000) 
	}
}

setInterval(refreshIns, 500); 